import { Link } from 'react-router-dom';

function Header({ history }) {

    const Res = {
        1: false,
        2: false,
        3: false,
        4: false,
        5: false,
        6: false,
        7: false,
        8: false,
        9: false,
        10: false,
        11: false,
        12: false,
        13: false,
        14: false,
        15: false,
        16: false,
        17: false,
        18: false
    }

    const goHome = () => {
        history.replace("/");
    }

    useEffect(() => {
        console.log(history);
        const unblock = history.block("응답한 결과가 전부 사라져요 🥲\n 정말 시작 화면으로 가실건가요?");
        return () => {
            unblock();
        };
    }, [history]);

    return (
        <div>
            <div className="Header">
                {/* <Link to={{pathname: "/", state: {Res: Res}} }style={{textDecoration: 'none', color: 'inherit'}}>
                    <div>투자 유니버스</div>
                </Link> */}
                <div onClick={goHome}>투자 유니버스</div>
            </div>
        </div>
    );
}

export default Header;
